import React from "react";

function Note() {
    return(
        <div className="note">
            <h1>Shopping</h1>
            <p>I have always wanted to go shopping, to spend all my money and ever get it back. But my Mother told me to save up a little bit each money so that in an unexpected event, I would have a 'safety net' to fall on.</p>
        </div>
    )
}

export default Note;
